import React from 'react';
import './App.css';
import { Home, CreateWodRoute } from './routes';
import {
  Switch,
  Route
} from "react-router-dom";
import { NotFound} from './components';
function App() {
  return (

      <div>
        <Switch>


        <Route path="/create">
            <CreateWodRoute />
          </Route>

          <Route path="/">
            <Home />
          </Route>

          <Route>
            <NotFound />
          </Route>






        </Switch>
      </div>
      );
  }

export default App;
